import "./UserCard.css";

const UserCard = ({
  avatar_url,
  name,
  login,
  location,
  bio,
  followers,
  following,
}) => {
  return (
    <div className="card">
      <img
        className="usercard__avatar"
        src={avatar_url}
        alt={`Foto de perfil de ${name}`}
      />
      <strong>{name}</strong>
      <p>@{login}</p>
      {location && <p>{location}</p>}
      <p>{bio}</p>
      <p>
        <strong>{followers}</strong> followers
      </p>
      <p>
        <strong>{following}</strong> following
      </p>
    </div>
  );
};

export default UserCard;
